import { Divider } from './skl-ds-divider';


export default {
  title: 'Example/Atoms/skl-ds-divider',
  component: Divider,
  argTypes: {
    color: {
      control: 'color',
      description: 'Colore del divider',
    },
    thickness: {
      control: 'text',
      description: 'Spessore del divider (es. "2px", "0.5rem")',
    },
    orientation: {
      control: {
        type: 'radio',
        options: ['horizontal', 'vertical'],
      },
      description: 'Orientamento del divider',
    },
    margin: {
      control: 'text',
      description: 'Margine attorno al divider (es. "8px", "1rem")',
    },
  },
};

const Template = (args) => <Divider {...args} />;

export const Horizontal = Template.bind({});
Horizontal.args = {
  color: '#ccc',
  thickness: '2px',
  orientation: 'horizontal',
  margin: '8px',
};

export const Vertical = Template.bind({});
Vertical.args = {
  color: '#000',
  thickness: '3px',
  orientation: 'vertical',
  margin: '16px',
};
